import React, { useState } from 'react';
import './sitemark-checkout.css';

const PrescriptionForm = () => {
  const [formData, setFormData] = useState({
    medicines: [{
      medicineName: '',
      dosage: '',
      quantity: '',
      frequency: '',
      instructions: ''
    }],
    patientId: '',
    doctorId: '',
    dateIssued: new Date().toISOString().split('T')[0],
    validUntil: '',
    notes: ''
  });

  const handleInputChange = (e, index = null) => {
    const { name, value } = e.target;
    if (index !== null) {
      const updatedMedicines = [...formData.medicines];
      updatedMedicines[index][name] = value;
      setFormData(prevState => ({ ...prevState, medicines: updatedMedicines }));
    } else {
      setFormData(prevState => ({ ...prevState, [name]: value }));
    }
  };

  const addMedicine = () => {
    setFormData(prevState => ({
      ...prevState,
      medicines: [...prevState.medicines, {
        medicineName: '',
        dosage: '',
        quantity: '',
        frequency: '',
        instructions: ''
      }]
    }));
  };

  return (
    <div className="checkout-container">
      <div className="order-summary">
        <h2>Prescription Summary</h2>
        <div className="order-items">
          {formData.medicines.map((medicine, index) => (
            <div key={index} className="order-item">
              <div className="order-item-details">
                <span className="order-item-name">{medicine.medicineName}</span>
                <span className="order-item-description">{medicine.dosage} - {medicine.frequency}</span>
              </div>
              <span>{medicine.quantity}</span>
            </div>
          ))}
        </div>
      </div>

      <div className="shipping-form">
        <div className="form-header">
          <div className="form-header-dot"></div>
          <h2>Prescription Form</h2>
        </div>
        <form>
          {formData.medicines.map((medicine, index) => (
            <div key={index} className="input-row">
              <input
                type="text"
                name="medicineName"
                placeholder="Medicine Name"
                value={medicine.medicineName}
                onChange={(e) => handleInputChange(e, index)}
              />
              <input
                type="text"
                name="dosage"
                placeholder="Dosage"
                value={medicine.dosage}
                onChange={(e) => handleInputChange(e, index)}
              />
              <input
                type="number"
                name="quantity"
                placeholder="Quantity"
                value={medicine.quantity}
                onChange={(e) => handleInputChange(e, index)}
              />
              <input
                type="text"
                name="frequency"
                placeholder="Frequency"
                value={medicine.frequency}
                onChange={(e) => handleInputChange(e, index)}
              />
              <input
                type="text"
                name="instructions"
                placeholder="Instructions"
                value={medicine.instructions}
                onChange={(e) => handleInputChange(e, index)}
              />
            </div>
          ))}
          <button type="button" className="next-button" onClick={addMedicine}>Add Medicine</button>
          <div className="input-container">
            <input
              type="text"
              name="patientId"
              placeholder="Patient ID"
              value={formData.patientId}
              onChange={handleInputChange}
            />
            <input
              type="text"
              name="doctorId"
              placeholder="Doctor ID"
              value={formData.doctorId}
              onChange={handleInputChange}
            />
            <input
              type="date"
              name="validUntil"
              value={formData.validUntil}
              onChange={handleInputChange}
            />
            <textarea
              name="notes"
              placeholder="Additional Notes"
              value={formData.notes}
              onChange={handleInputChange}
            />
          </div>
          <button type="submit" className="next-button">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default PrescriptionForm;
